import '@babel/core'
import 'bootstrap/dist/css/bootstrap.min.css';
import {Table, Button, Container, Modal, ModalBody, ModalHeader, FormGroup, ModalFooter}from 'reactstrap'

//Arrailis 
const data = [
{ id: 1, personaje: "juan diego", anime: "naruto"},
{ id: 2, personaje: "pepe", anime: "obe punchman"},
{ id: 3, personaje: "pepe chato", anime: " mushucu tensei"},
{ id: 4, personaje: "pablito", anime: "padres de familia"},
{ id: 5, personaje: "ven10", anime: "dargonball"},


];


function App() {
    state={
      data: data
    }

  return (
    <>
      <Container>
      <br/>
      <Button color="primary">insertar nuevo personage</Button>
    <br/><br/>

      <Table>

        <thead><th><th>Id</th>
        <th>personaje</th>
        <th>anime</th>
        <th>Acciones</th></th></thead>

        <tbody>
          {this.state.data.map((elemanto)=>(
            <tr>
                <td>{elemento.id}</td>
                <td>{elemento.personaje}</td>
                <td>{elemento.anime}</td>
                <td><Button color="primary">Editar</Button></td>
                <td><Button color="danger">Eliminar</Button></td>

            </tr>
          ))}




        </tbody>


      </Table>

      </Container>
    </>

  );
}

export default App;
